const e=JSON.parse('{"key":"v-bacf8d92","path":"/lc871.html","title":"871. 最低加油次数","lang":"en-US","frontmatter":{"tag":"贪心"},"headers":[],"git":{"createdTime":1728280302000,"updatedTime":1728280302000,"contributors":[{"name":"HouShengming","email":"18865290907@163.com","commits":1}]},"readingTime":{"minutes":1.31,"words":394},"filePathRelative":"lc871.md","localizedDate":"October 7, 2024","excerpt":"<h1> 871. 最低加油次数</h1>\\n<p>汽车从起点出发驶向目的地，该目的地位于出发位置东面 <code>target</code> 英里处。</p>\\n<p>沿途有加油站，用数组 <code>stations</code> 表示。其中 <code>stations[i] = [positioni, fueli]</code> 表示第 <code>i</code> 个加油站位于出发位置东面 <code>positioni</code> 英里处，并且有 <code>fueli</code> 升汽油。</p>\\n<p>假设汽车油箱的容量是无限的，其中最初有 <code>startFuel</code> 升燃料。它每行驶 <code>1</code> 英里就会用掉 <code>1</code> 升汽油。当汽车到达加油站时，它可能停下来加油，将所有汽油从加油站转移到汽车中。</p>"}');export{e as data};
